(1, '<p><b>                                  Agreement between the agent and the company platform.</b></p><p>\r\n<br>1.Acceptance of Terms\r\nBy accessing or using this website, you agree to be bound by these Terms of Use and all applicable laws and regulations. If you do not agree with any of these terms, you are prohibited from using or accessing this site.</p><p>\r\n<br>2. Services Provided\r\nThe Company provides rating reviews, information, and related services. All services are subject to change or termination at any time without prior notice.</p><p>\r\n<br>3. Use of Website\r\n<br>3.1 You agree to use this website only for lawful purposes.\r\n<br>3.2 You shall not attempt to gain unauthorized access to any portion or feature of the website.\r\n<br>3.3 You shall not use any automated means to access the website without the Company prior written permission.<br><br>4. Eligibility\r\nYou must be at least 18 years of age to use this website. By using the website, you represent and warrant that you meet this eligibility requirement.\r\n<br><br>5. Registration and Account Security<br>5.1 Some services may require registration. You agree to provide accurate information when creating an account.\r\n<br>5.2 You are responsible for maintaining the confidentiality of your account information.\r\n<br>5.3 You agree to notify the Company immediately of any unauthorized use of your account.<br><br>6. Fees and Payment\r\n<br>6.1 Certain services may require payment of fees.\r\n<br>6.2 The Company reserves the right to change its fees at any time.\r\n<br>6.3 All fees are non-refundable unless otherwise stated.\r\n<br></p><p>7. Rating Review<br>7.1 The Company provides rating reviews based on submissions received.\r\n<br>7.2 Ratings are based on the Company proprietary guidelines.\r\n<br>7.3 Ratings are subject to change at the Company’s discretion.\r\n<br>7.4 If the Agent wishes to extend the rating review and/or other changes after conducting the Rating Review, including but not limited to changing the Agent\'s details, the Agent should contact Customer Service. Fees may apply to applicable suppliers if the rating reviews are extended.\r\n<br></p><p>8. Submissions<br>8.1 By submitting any content to the website, you grant the Company a worldwide, royalty-free, perpetual, irrevocable, non-exclusive right and license to use, reproduce, modify, adapt, publish, translate, distribute, and display such content.\r\n<br>8.2 You represent and warrant that you own or otherwise control all of the rights to the content you submit.<br>8.3 You acknowledge and agree that Submissions are non-confidential and non-proprietary.<br>8.4 The Company is not responsible for any submissions posted by you.<br>8.5 You are solely responsible for the content you submit and agree not to post unlawful, threatening, libelous, defamatory, obscene, pornographic, or otherwise objectionable material.<br><br>9. Works\r\n<br>9.1 All submissions are subject to the Guidelines for Submission of Works.\r\n<br>9.2 By the Work Submission Guidelines, any work you submit must:<br>(a) Be thematically relevant to film, director, production company, or general screenplay experience.<br>(b) Be community/family friendly.<br>(c) Not be illegal, obscene, pornographic, vulgar, or abusive.<br>(d) Not infringe the privacy or rights of others.<br>(e) Not involve children or third parties without proper consent.<br>(f) Be original, and not infringe third-party rights.<br>(g) Be non-commercial.<br></p><p>10. Disclaimer\r\n<br>10.1 The information, software, products, and services on this website may contain inaccuracies or errors.<br>10.2 The Company and its affiliates do not warrant the accuracy or suitability of the information provided.<br>10.3 The Company disclaims all warranties and conditions, including implied warranties of merchantability or fitness for a particular purpose.<br>10.4 The Company shall not be liable for any direct, indirect, incidental, punitive, or consequential damages arising out of use or inability to use this website.<br></p><p>11. Third-Party Relations\r\n<br>11.1 The Company is not responsible for disputes with third parties.<br>11.2 The Company does not disclose costs to Clients unless required.<br>11.3 The Company is a technology provider, not a product provider.<br><br>12. Indemnity\r\nYou agree to indemnify the Company against claims, damages, or losses caused by your breach of these Terms, violation of rights of third parties, or misuse of the website.<br><br>13. Links to Third Party Websites\r\nThis website may contain hyperlinks to external websites. The Company is not responsible for the content of such third-party websites.<br><br>14. Copyright and Trademark Notices\r\nAll website contents are copyrighted by the Company. Other product and company names mentioned may be trademarks of their respective owners.\r\n\r\n\r\n15.Counter-Notifications\r\n<br><br>14.1 If you believe any content infringes your copyright, you may send written notice including:\r\nIdentification of the copyrighted work.\r\nIdentification of the infringing material.\r\nContact information.<br>14.2 Incorrect or incomplete complaints will not be processed.<br>14.3 The Company may remove infringing material upon valid notice. <br><br>14.4 For questions, contact Live Technical Support<br><br>15. Account Termination\r\nThe Company may terminate accounts of repeat infringers. The Company may restrict or terminate access at its sole discretion.\r\n<br><br>16. General\r\n<br>16.1 This Agreement is governed by the laws of USA<br>16.2 For questions, contact Live Technical Support<br>16.3 Disputes shall be resolved by arbitration in USA under SIAC rules.<br>16.4 The Company may assign or delegate its rights.<br>16.5 No joint venture, partnership, or employment relationship is created by this Agreement.<br>16.6 If any provision is unenforceable, it shall be replaced by a valid provision, and the remainder will survive.<br>16.7 This Agreement constitutes the entire agreement between you and the Company and supersedes all prior communications.\r\n                              </p>', '<p><b>                                  Privacy Policy\r\n<br></b></p><p>(a) Affiliates\r\n\r\n(For example, subsidiaries and other companies owned or controlled by Platform Companies)<br><br>(b) Service Providers\r\n\r\nWe engage service providers to provide limited administrative and communication services on our behalf, such as website hosting, processing and deposits, withdrawals, rating review services and providing customer support. The Platform does not authorize these service providers to use your personal information except to provide those services we request. We provide your personal information to service providers to complete your purchase of platform service products. The service providers mentioned in this paragraph may be located in or outside Singapore. In this regard, by accepting this Privacy Policy or continuing to access or use our website or mobile application, you are deemed to have agreed and agreed that such service providers may, to the extent necessary, provide you with services through our website on behalf of, collect, use, disclose and/or process information about you.<br><br>(c) Legal Advisers\r\n\r\nOur legal advisers or other professional advisers.<br><br>(d) Third Parties\r\n\r\nThird parties necessary to conduct a merger, acquisition or otherwise; to support the sale or transfer of business assets; to exercise our rights or to protect our property; to protect the rights, property or safety of others, to investigate fraud, and to respond to government requests; or as needed to support audit, compliance and corporate governance functions.\r\n\r\nIf a Platform Company is involved in a merger, acquisition or sale of all or part of its assets, you will be notified of any changes in the ownership or use of your personal information, as well as any changes you may have regarding your personal information, through a Platform System announcement and/or a prominent notice on our website.<br><br>(e) Required Disclosure\r\n\r\nNecessary third parties or authorities to defend themselves in litigation or regulatory action, and when required or advised by law to do so, such as in response to a subpoena or similar legal process, including law enforcement agencies, regulatory agencies, and Singapore and our operations the courts of other countries in which it is located.\r\n\r\nCollection and Use of Information About Your Computer\r\n\r\nBy using the services or software on our website and mobile applications, you expressly consent to the transfer and use of such information as set forth herein. If you do not agree to this, please do not continue to use the service and you may choose to delete or delete any personal information we have collected at any time by contacting us on [Live Customer Service].\r\n\r\nThese services use Internet protocols to send computer information to appropriate systems, such as.<br>(a) your Internet Protocol address.<br>(b) the type of operating system.<br>(c) browser and name and version.<br><span style=\"font-size: 1rem;\">(d) your hardware information.<br>(e) your region and language settings.<br>(f) the software version you are using and.<br>(g) the language code of the device on which you install the software.\r\n\r\nThe platform uses this information to provide you with other features and services. The platform may use computer information to improve our services. We may also share such non-personal information with others, such as hardware and software vendors. They may use this information to improve the way their products work on our services.\r\n\r\nCookies and Related Technologies\r\n\r\nCookies are small files of letters and numbers that are stored on your computer by the websites you visit. Cookies enable us to help you in a number of ways; for example, by allowing us to personalize our website by providing you with recommendations based on your browsing history or preferences that you have previously selected. By using our website, you acknowledge and agree to our use of cookies to collect web data, conduct online behavioral advertising campaigns, and enhance the overall customer experience.\r\n\r\nIf you do not consent to the company\'s use of cookies for these purposes, you may opt-out by modifying the settings of the internet browser you use. However, please note that if you opt out here, certain areas of our website that require the collection of relevant data may not be available to you.\r\n\r\nFor our internal purposes, we may use third-party web analytic services to track certain information related to your use of our website. Our website uses Google Analytics, a web traffic analysis service provided by Google Inc. (\"Google\").\r\n\r\nWe use the following cookies.<br><br>(a) Strictly Necessary Cookies. These are required for our website to function.<br>(b) Analytic/performance cookies. They allow us to identify and count the number of visitors and see how visitors move around.<br>(c) Functional cookies. These are used to identify you when you return to our website.<br>(d) Targeting cookies. These record your visit to our website, the pages you visit and the links you follow.\r\n\r\nYour Choice\r\n\r\nWe believe that as we learn more about you and the kinds of services you enjoy, you will benefit from a more personalized experience. However, you can limit the information you provide to the Platform and the communications that the Platform sends to you.\r\n\r\nAccess and Correction of Personal Information\r\n\r\nRight to use. You have the right to access the personal data we hold about you.\r\n\r\nCorrection: You have the right to correct any inaccurate personal data.\r\n\r\nIf you want to inquire, correct or request to delete your personal data, please contact us through [Online Customer Service].<br></span></p><p><span style=\"font-size: 1rem;\">Personal Information Security\r\n\r\nWe follow generally accepted standards to protect personal information submitted to us, both during transmission and after we receive it. Any payment transactions will be encrypted using SSL technology.\r\n\r\nIf we provide you (or you choose) a password, you are responsible for keeping it confidential.\r\n\r\nNo method of transmission over the Internet or method of electronic storage is 100% secure. Therefore, we cannot guarantee its absolute safety.\r\n\r\nPrivacy Practices of Third Parties\r\n\r\nThis Privacy Policy addresses the Platform\'s use and disclosure of information solely through your interactions with our website and mobile applications.\r\n\r\nOther websites accessible through links from our website may have their own privacy policies or statements. We encourage you to familiarize yourself with them.\r\n\r\nChanges to This Privacy Policy\r\n\r\nWe may update this Privacy Policy from time to time to clarify our practices or reflect new or different practices. If we make material changes, we will notify you through a notice on the website and mobile application.\r\n\r\nLinks to Other Websites\r\n\r\nOur website may contain links to other websites. We do not control third-party websites. These other websites may place cookies, collect data, or request information from you.\r\n\r\nData Transmission\r\n\r\nFrom time to time, we may save your data on servers in the United States and other locations we deem appropriate. We may also transfer your data to our overseas offices or service providers and/or business partners.\r\n\r\nWe are committed to adequately protecting your personal data regardless of where it is located.\r\n\r\nPlatform Updates\r\n\r\nIn order to better protect the security of each account, the platform will update, maintain and backup from time to time, so the platform will also change the website from time to time.</span><br></p>', '2025-08-03 04:25:39', '2025-09-25 14:51:28');
