(1, '<p><b>About Agent Magic</b><br></p><p></p>', '<p><span style=\"color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \" color=\"\">Platform\r\n users can invite others to become agents of the platform through the \r\ninvitation code and also become your downline, as the upline you can \r\nextract 10% of the commission of the downline, the commission obtained \r\nby the upline will be directly returned to the upline\'s platform \r\naccount, or you can also check the team report.</span></p><p></p>', '2025-08-11 10:03:18', '2025-08-13 06:43:53'),
(2, '<p><b>About <small style=\"padding: 0px; margin: 0px; box-sizing: border-box; line-height: 1.2rem; font-size: 0.875em;\"><b>Withdrawal</b></small></b></p>', '<p style=\"padding: 0px; margin: 0px 0px 1rem; box-sizing: border-box; line-height: 1.2rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" white-space:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-thickness:=\"\" initial;=\"\" text-decoration-style:=\"\" text-decoration-color:=\"\" initial;\"=\"\"><small style=\"padding: 0px; margin: 0px; box-sizing: border-box; line-height: 1.2rem; font-size: 0.875em;\">After completing two set of orders, you can submit a withdrawal request . Ensure your bank information is linked to the platform before withdrawal. Click the \"Withdrawal\" button, enter the withdrawal amount and your password. The arrival time depends on your bank.</small></p><p style=\"padding: 0px; margin: 0px 0px 1rem; box-sizing: border-box; line-height: 1.2rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"